import React from 'react';

function TodoItem({ title, completed, onToggle, onRemove }) {
    return (
        <li>
            <span
                style={{ textDecoration: completed ? 'line-through' : 'none' }}
                onClick={onToggle}
            >
                {title}
            </span>
            <button className="remove-button" onClick={onRemove}> - </button>
        </li>
    );
}

export default TodoItem;
